// ==UserScript==
// @name         夸克网盘会员青春版
// @author       hmjz100
// @namespace    github.com/hmjz100
// @version      1.0.0
// @description  《也许同类型中最好用？》系列 - 显示夸克网盘身份信息为会员，支持修改头像、修改用户名等功能，自定义程度超高！需要修改头部代码来配置显示内容（非常简单！）
// @icon         data:image/x-icon;base64,
// @license      MIT
// @match        *://pan.quark.cn/*
// @run-at       document-start
// @grant        unsafeWindow
// @downloadURL https://update.greasyfork.org/scripts/519767/%E5%A4%B8%E5%85%8B%E7%BD%91%E7%9B%98%E4%BC%9A%E5%91%98%E9%9D%92%E6%98%A5%E7%89%88.user.js
// @updateURL https://update.greasyfork.org/scripts/519767/%E5%A4%B8%E5%85%8B%E7%BD%91%E7%9B%98%E4%BC%9A%E5%91%98%E9%9D%92%E6%98%A5%E7%89%88.meta.js
// ==/UserScript==

(function () {
	var user = {
		// 以下设置项中，常规项目（就是以//开头注释的项目）除非特殊说明，否则一般 0 为关闭，1 为开启
		vip: 1, // 开启超级会员修改（总开关）
		// 注意，如果仅启用官网弃用的 VIP 的话网页不会显示过期时间。
		svip: 1, // 显示为超级会员，建议 1
		svipZ: 1, // 显示为超级会员+，建议 1
		previous: 0, // 显示为会员过期，建议 0，变为仅修改历史最高的会员类型

		// 以下是自定义项目（以/*开头注释的项目），修改也非常简单
		/*
		自定义用户名与头像还有邮箱、手机号，留空则使用已登录账号数据
		*/
		name: "百试不如一议",
		photo: "https://cdn.auth0.com/avatars/bs.png",
		/*
		会员过期时间 格式为Unix时间戳，可留空为""
		1548950400 - 2019-02-01 00:00:00 (夸克网盘上线时)
		2147483648 - 2038-01-19 11:14:08 (2038问题时)
		253402185600 - 9999-12-31 00:00:00 (终极时)
		*/
		endtime: 253402185600,

		// 以下的常规项目（就是以//开头注释的项目）均为独立功能，不受总开关控制
		analytics: 0, // 允许夸克网盘网页分析浏览信息，建议 0，分析原理是以 XHR、Fetch 或 navigator.sendBeacon 的形式让浏览器访问特殊的网址来给服务器传递信息
		debug: 0, // 显示本脚本的调试信息到 JavaScript 控制台中，建议 0，另外，1 显示所有，2 仅显示 Hook 修改参数，3 仅显示禁用网页分析
	}

	var originalOpen = XMLHttpRequest.prototype.open;
	var originalSendBeacon = navigator.sendBeacon;

	unsafeWindow.XMLHttpRequest.prototype.open = function (method, url) {
		if (url === undefined) return;
		url = new URL(url, location.href).href;
		this.url = url;
		if (url.includes('account/info')) {
			// 用户信息
			user.vip ? this.addEventListener('readystatechange', function () {
				if (this.readyState === 4 && this.status === 200) {
					let res, oriRes;
					try {
						res = JSON.parse(this.responseText), oriRes = JSON.parse(this.responseText);
					} catch (e) {
						res = this.response, oriRes = this.response;
					}

					if (user.name) res.data.nickname = user.name;
					if (user.photo) res.data.avatarUri = user.photo;

					if (user.debug === 1 || user.debug === 2) console.log("【夸克网盘会员青春版】Hook XHR", "\n请求地址:", url, "\n原始回复:", oriRes, "\n修改回复:", res);

					Object.defineProperty(this, "responseText", {
						writable: true,
					});
					Object.defineProperty(this, "response", {
						writable: true,
					});
					this.response = JSON.stringify(res);
					this.responseText = JSON.stringify(res);
				}
			}) : ""
		} else if (url.includes('clouddrive/member')) {
			// 会员信息
			user.vip ? this.addEventListener('readystatechange', function () {
				if (this.readyState === 4 && this.status === 200) {
					let res, oriRes;
					try {
						res = JSON.parse(this.responseText), oriRes = JSON.parse(this.responseText);
					} catch (e) {
						res = this.response, oriRes = this.response;
					}

					/*
						非会员 = "NORMAL"
						VIP（已弃用） = "VIP" = 无
						VIPz_vip_exp_at 过期 = "EXP_VIP" = 无
						SVIP = "SUPER_VIP" = "super_vip_exp_at"
						SVIP 过期 = "EXP_SVIP" = "super_vip_exp_at"
						SVIP+ = "Z_VIP" = "z_vip_exp_at"
						SVIP+ 过期 = "EXP_SVIP" = "z_vip_exp_at"
					*/

					let vip_type, endtime_type;
					if (user.previous === 1) {
						if (user.vip) {
							vip_type = "EXP_VIP";
						}
						if (user.svip === 1) {
							vip_type = "EXP_SVIP";
							endtime_type = "super_vip_exp_at";
						}
						if (user.svipZ === 1) {
							vip_type = "EXP_SVIP";
							endtime_type = "z_vip_exp_at";
						}
					} else {
						if (user.vip) {
							vip_type = "VIP";
						}
						if (user.svip === 1) {
							vip_type = "SUPER_VIP";
							endtime_type = "super_vip_exp_at";
						}
						if (user.svipZ === 1) {
							vip_type = "Z_VIP";
							endtime_type = "z_vip_exp_at";
						}
					}

					res.data.member_type = vip_type;
					if (endtime_type) res.data[endtime_type] = user.endtime ? (user.endtime * 1000) : (Date.now() + (24 * 60 * 60 * 1000));

					for (let key in res.data.member_status) {
						if (res.data.member_status.hasOwnProperty(key)) {
							res.data.member_status[key] = "PAID";
						}
					}

					if (user.debug === 1 || user.debug === 2) console.log("【夸克网盘会员青春版】Hook XHR", "\n请求地址:", url, "\n原始回复:", oriRes, "\n修改回复:", res);

					Object.defineProperty(this, "responseText", {
						writable: true,
					});
					Object.defineProperty(this, "response", {
						writable: true,
					});
					this.response = JSON.stringify(res);
					this.responseText = JSON.stringify(res);
				}
			}) : ""
		} else if (url.includes('clouddrive/file') && url.includes('play')) {
			// 播放信息
			user.vip ? this.addEventListener('readystatechange', function () {
				if (this.readyState === 4 && this.status === 200) {
					let res, oriRes;
					try {
						res = JSON.parse(this.responseText), oriRes = JSON.parse(this.responseText);
					} catch (e) {
						res = this.response, oriRes = this.response;
					}

					// 高清都不许我看，留你有何用？删了便是！
					function removeNoUrl(list) {
						if (Array.isArray(list)) {
							list.forEach((item, i) => {
								removeNoUrl(item);
								if (!item?.video_info?.url) list.splice(i, 1); // 删除没有实际链接的清晰度
							});
						} else if (list && typeof list === "object") {
							Object.values(list).forEach(value => removeNoUrl(value));
						}
					}
					removeNoUrl(res.data.video_list);

					if (user.debug === 1 || user.debug === 2) console.log("【夸克网盘会员青春版】Hook XHR", "\n请求地址:", url, "\n原始回复:", oriRes, "\n修改回复:", res);

					Object.defineProperty(this, "responseText", {
						writable: true,
					});
					Object.defineProperty(this, "response", {
						writable: true,
					});
					this.response = JSON.stringify(res);
					this.responseText = JSON.stringify(res);
				}
			}) : ""
		}
		if (user.analytics === 0 && (url.includes('px.effirst.com') || url.includes('127.0.0.1'))) {
			if (user.debug === 1 || user.debug === 3) console.warn("【夸克网盘会员青春版】unAnalytics", '\n类型：XHR\n禁止网页分析信息:', url);
			return;
		}
		return originalOpen.apply(this, arguments);
	};

	const originalFetch = window.fetch;
	if (user.analytics === 0) unsafeWindow.fetch = async function (url, options) {
		if (url === undefined) return;
		url = new URL(url, location.href).href;
		if ((url.includes('taobao.com') && url.includes('r.png')) || url.includes('pc/order/status')) {
			if (user.debug === 1 || user.debug === 3) console.warn("【夸克网盘会员青春版】unAnalytics", '\n类型：fetch\n禁止网页分析信息:', url);
			return;
		}
		return await originalFetch(url, options);
	};

	if (user.analytics === 0) unsafeWindow.navigator.sendBeacon = function (src, data) {
		if (src === undefined) return;
		let url = new URL(src, location.href).href;
		if (url.includes('track.lc.quark.cn') || url.includes('jssdk/upload')) {
			if (user.debug === 1 || user.debug === 3) console.warn("【夸克网盘会员青春版】unAnalytics", '\n类型：navigator.sendBeacon\n禁止网页分析信息:', url);
			return;
		}
		return originalSendBeacon.apply(this, arguments);
	};
})();